import View from 'react-native';
import { Marker } from 'react-native-maps'



export default function TripScreen(){
    return (

        <View>
             <MapView
                region={this.state.region}
                onRegionChange={this.onRegionChange}
              >{this.state.markers.map((marker, index) => (
                <Marker
                  key={index}
                  coordinate={marker.latlng}
                  title={marker.title}
                  description={marker.description}
               />
              ))}
        </MapView>
        </View>
    );
}
const styles =({
    imageContainer: {
        width:300,
        height:50,
        alignItems: 'center'
    },
    container: {
        flex: 1,
      },
      image: {
        flex: 1,
        justifyContent: "center"
      },
      text: {
        color: "black",
        fontSize: 40,
        lineHeight: 84,
        fontWeight: "bold",
        textAlign: "center",
        backgroundColor: "#000000c0"
      },
      containerViewHome:{
        position:'absolute',
        top:0,
        bottom:0,
        left:0,
        right:0
      },
      animatedView:{
        flex:1,
        alignItems:'center',
        justifyContent:'center'
      },
      logoContainer:{
        width: '100%',
        height: '100%'
      }
  });
